local function createStringProxy(str)
    local proxy = { value = str }
    setmetatable(proxy, {
        -- tostring(proxy) -> underlying string
        __tostring = function(self) return self.value end,
        -- proxy .. other or other .. proxy
        __concat = function(a, b)
            local aval = (type(a) == "table" and a.value) or a
            local bval = (type(b) == "table" and b.value) or b
            return createStringProxy(tostring(aval) .. tostring(bval))
        end,
    })
    return proxy
end

-- Fallback writer: try writefile, then clipboard, else print
local function safeWrite(name, content)
    if writefile then
        pcall(function() writefile(name, content) end)
    elseif setclipboard or toclipboard or set_clipboard then
        -- support various executors' clipboard APIs
        local copy = setclipboard or toclipboard or set_clipboard or (Clipboard and Clipboard.set)
        pcall(function() copy(content) end)
    else
        print(content)
    end
end

-- Counters for unique output files
local hook_id = { load = 0, loadstring = 0, dofile = 0, loadfile = 0, require = 0, httpget = 0 }

-- Hook string.char: return proxy instead of raw string
pcall(function()
    local origChar = string.char
    string.char = function(...)
        local s = origChar(...)
        return createStringProxy(s)
    end
end)

-- Hook table.concat: join elements (via tostring) and return a proxy
pcall(function()
    local origConcat = table.concat
    table.concat = function(tbl, sep, i, j)
        sep = sep or ""
        i = i or 1
        j = j or #tbl
        -- Collect string representations of the slice
        local parts = {}
        for idx = i, j do
            parts[#parts + 1] = tostring(tbl[idx])
        end
        local result = origConcat(parts, sep)
        return createStringProxy(result)
    end
end)

-- Hook loadstring (and load): capture code and return dummy function
pcall(function()
    -- If loadstring unavailable (Lua 5.2+), use load
    local origLS = loadstring or load
    loadstring = function(code, ...)
        local codeStr = tostring(code)
        hook_id.loadstring = hook_id.loadstring + 1
        safeWrite("deob_loadstring_"..hook_id.loadstring..".lua", codeStr)
        -- Return empty function so code does not run
        return function() end
    end
    -- Also hook load similarly
    local origLoad = load
    load = function(code, ...)
        local codeStr = tostring(code)
        hook_id.load = hook_id.load + 1
        safeWrite("deob_load_"..hook_id.load..".lua", codeStr)
        return function() end
    end
end)

-- Hook dofile: note path, but do not execute
pcall(function()
    local origDofile = dofile
    dofile = function(path)
        hook_id.dofile = hook_id.dofile + 1
        safeWrite("deob_dofile_"..hook_id.dofile..".txt", "dofile path: "..tostring(path))
        return nil
    end
end)

-- Hook loadfile: note path, return dummy
pcall(function()
    local origLoadfile = loadfile
    loadfile = function(path)
        hook_id.loadfile = hook_id.loadfile + 1
        safeWrite("deob_loadfile_"..hook_id.loadfile..".txt", "loadfile path: "..tostring(path))
        return function() end
    end
end)

-- Hook require: capture module id and return empty table
pcall(function()
    local origRequire = require
    require = function(mod, ...)
        hook_id.require = hook_id.require + 1
        safeWrite("deob_require_"..hook_id.require..".txt", "require: "..tostring(mod))
        return {}
    end
end)

-- Hook game:HttpGet to capture fetched code
pcall(function()
    local origHttpGet = game.HttpGet
    game.HttpGet = function(self, url, ...)
        local content = origHttpGet(self, url, ...)
        hook_id.httpget = hook_id.httpget + 1
        safeWrite("deob_httpget_"..hook_id.httpget..".lua", content)
        return content
    end
end)

-- Hook game:HttpGetAsync similarly (with callback)
pcall(function()
    local origHttpGetAsync = game.HttpGetAsync
    game.HttpGetAsync = function(self, url, callback, ...)
        origHttpGetAsync(self, url, function(content)
            hook_id.httpget = hook_id.httpget + 1
            safeWrite("deob_httpget_"..hook_id.httpget..".lua", content)
            if callback then
                pcall(callback, content)
            end
        end, ...)
    end
end)
